INSERT INTO `perguntas_respostas` (`codigo`, `pergunta`, `resposta`, `link`) VALUES
(1, '01- O que é a Lei de Acesso à Informação?', 'A Lei nº 12.527/2011, conhecida como Lei de Acesso à Informação - LAI, regulamenta o direito, previsto na Constituição, de qualquer pessoa solicitar e receber dos órgãos e entidades públicos, de todos os entes e Poderes, informações públicas por eles produzidas ou custodiadas.', ''),
(2, '02- Qual o objetivo do Portal da Transparência?', 'O Portal da Transparência é uma ferramenta que visa promover o amplo acesso aos dados referentes à aplicação dos recursos públicos pela Prefeitura. Por meio do Portal, qualquer cidadão pode acompanhar as ações da administração direta e indireta e a gestão das finanças.', ''),
(3, '03- Qual a legislação que criou o Portal da Transparência?', 'O marco legal para a criação dos portais de transparência em todos os entes da União (governo Federal, Estadual e Municipal) foi a promulgação da Lei Complementar n.º 131, de 27/05/2009, que alterou a Lei Complementar n.º 101, de 06/05/2000 - Lei de Responsabilidade Fiscal. A Lei Federal n.º 12.527, de 18 de novembro de 2011, chamada de Lei de Acesso à Informação - LAI, dispôs e regulou o direito de acesso à informação garantido na Constituição Brasileira. ', ''),
(4, '04- O que são informações?', 'De acordo com o art. 4°, inciso I, da Lei nº 12.527/2011, informações são dados, processados ou não, que podem ser utilizados para produção e transmissão de conhecimento, registrados em qualquer suporte ou formato.', ''),
(5, '05- A que tipo de informação os cidadãos podem ter acesso pela Lei de Acesso?', 'Com a Lei de Acesso, a publicidade passou a ser a regra e o sigilo a exceção. Dessa forma, as pessoas podem ter acesso a qualquer informação pública produzida ou custodiada pelos órgãos e entidades da Administração Pública. A Lei de Acesso, entretanto, prevê algumas exceções ao acesso às informações, notadamente àquelas cuja divulgação indiscriminada possa trazer riscos à sociedade ou ao Estado.', ''),
(6, '06- Quem deve prestar as informações?', 'Todos os órgãos públicos integrantes da administração direta, indireta, as autarquias, as fundações públicas, as empresas públicas, as sociedades de economia mista e demais entidades controladas direta ou indiretamente pela Prefeitura. As entidades privadas que recebam para realização de ações de interesse público, recursos públicos diretamente do orçamento ou mediante subvenções sociais. Os gestores de cada um dos órgãos supramencionados deverão designar, no prazo determinado em lei, um servidor que terá por função atender e monitorar que todas as consultas dos cidadãos sejam atendidas no prazo máximo de 20 (vinte) dias, de forma clara e transparente. ', ''),
(7, '07- Quais informações deverão estar disponíveis?', 'No Portal da Transparência podem ser encontradas informações sobre o Orçamento Municipal (PPA, LDO e LOA), as receitas auferidas, as despesas realizadas, os procedimentos licitatórios e os contratos firmados pelo município, o quadro funcional dos servidores e a folha de pagamento. Deverão ser disponibilizadas, também, as informações que tratem da estrutura dos órgãos, seus programas e metas, endereço, telefones, listagem de servidores e suas funções, tabelas salariais, registros de aplicação dos recursos ou transferências financeiras, licitações, contratos e convênios, bem como o plano de aplicação de verbas e respectivas prestações de contas e obras e seus cronogramas de execução ', ''),
(8, '08- Quais os locais onde o cidadão poderá encontrar respostas para as suas consultas?', 'As informações estão disponíveis no PORTAL DA TRANSPARENCIA DO MUNICIPIO.\r\n', ''),
(9, '09- Quem pode solicitar as informações?', 'Todo cidadão pode consultar os dados disponibilizados no PORTAL DA TRANSPARÊNCIA - O acesso às informações é livre, independe de senhas ou autorizações, bastando que o interessado possua conexão com a internet.', ''),
(10, '10- Como fazer se não encontrar a informação no Portal da Transparência?', 'Além do Portal da Transparência, o acesso à informação pode ser protocolado pelo E-SIC (Sistema Eletrônico do Serviço de Informação ao Cidadão), que está acoplado ao PORTAL DA TRANSPARÊNCIA ou pessoalmente, através do Sic (Serviço de Informação ao Cidadão) nos órgãos de Atendimento do Municipio.\r\nae as alterações.', ''),
(11, '11- É preciso identificação para fazer a consulta?', 'É preciso a identificação básica para que o requerente possa receber a resposta (nome, número do documento de identificação ou número de inscrição no cadastro de pessoas físicas - CPF, bem como dados do endereço para aviso da disponibilização da resposta). ', ''),
(12, '12- É preciso justificar o pedido de acesso à informação?', 'Não. De acordo com o art. 10, § 8° da Lei de Acesso, é proibido exigir que o solicitante informe os motivos de sua solicitação. Entretanto, o órgão/entidade pode dialogar com o cidadão para entender melhor a demanda, de modo a fornecer a informação mais adequada a sua solicitação.', ''),
(13, '13- É preciso pagar pelas informações?', 'As informações de caráter geral e disponibilizadas através do PORTAL DA TRANSPARÊNCIA ou via e-mail, serão gratuitas. Em nenhuma hipótese o servidor público poderá receber valores pelo serviço prestado ao cidadão que requerer informações sobre a Administração Pública. \r\nConforme dispõe o art. 12 da Lei de Acesso à Informação, o serviço de busca e fornecimento da informação é gratuito. Entretanto, podem ser cobrados os custos dos serviços e dos materiais utilizados na reprodução e envio de documentos. Neste caso, o órgão ou entidade deverá disponibilizar ao solicitante uma Guia de Recolhimento ou documento equivalente para que ele possa realizar o pagamento.\r\n', ''),
(14, '14- Qual o prazo para os órgãos fornecerem as informações requeridas?', 'As informações deverão ser prestadas logo após o requerimento, em não o fazendo o órgão deverá enviar resposta ao requerente, justificando a dilação do prazo e determinando a data em que enviará a informação. O prazo para resposta não poderá exceder a 20 dias contados da data da apresentação do requerimento, podendo ser prorrogado por mais 10 (dez) mediante justificativa expressa, cientificando-se o requerente da prorrogação. ', ''),
(15, '15- Como são contados os prazos para resposta dos órgãos e entidades, de acordo com a LAI?', 'A contagem dos prazos previstos em dia pela Lei nº 12.527/2011 (Lei de Acesso à Informação – LAI) e em seu decreto regulamentador (Decreto º 7.724/2012)  segue as regras da Lei de Processo Administrativo (Lei nº 9.784/1999):\r\n“Art. 66. Os prazos começam a correr a partir da data da cientificação oficial, excluindo-se da contagem o dia do começo e incluindo-se o do vencimento.\r\n        § 1º Considera-se prorrogado o prazo até o primeiro dia útil seguinte se o vencimento cair em dia em que não houver expediente ou este for encerrado antes da hora normal.\r\n        § 2º Os prazos expressos em dias contam-se de modo contínuo.”\r\n Em que pese o Sistema Eletrônico do Serviço de Informações ao Cidadão (e-SIC) funcione 24 horas por dia, em todos os dias da semana, a “cientificação oficial” se dá apenas durante o horário de expediente padrão dos órgãos e entidades do Poder.\r\nSeguem regras de contagem de prazo:\r\n1. A contagem do prazo se inicia no dia útil posterior à “cientificação oficial” e, a partir desse momento, se dá de forma contínua, independentemente de passar por dias úteis ou não úteis e incluirá o dia do vencimento.\r\n2 – A “cientificação oficial” se dá conforme tabela abaixo:\r\nRegistro no e-SIC			Cientificação oficial\r\nEm dia útil, antes das 18hs.		Mesmo dia do registro no e-SIC.\r\nEm dia útil, a partir das 18hs.		Próximo dia útil.\r\nEm dia não útil, a qualquer hora.	Próximo dia útil.\r\n\r\n3 - Na eventualidade do último dia do prazo cair em dia não útil ou em dia de expediente reduzido, o prazo será estendido até o próximo dia útil de expediente completo. \r\n Cabe ressaltar que as regras apresentadas acima se aplicam a todas as contagens de prazo do sistema e-SIC, seja o prazo para uma ação do órgão demandado (responder pedido, responder recursos, etc), seja para uma ação do solicitante (registrar reclamação, interpor recursos, etc).\r\nDestaca-se, ainda, que os feriados e pontos facultativos, considerados neste cenário, são aqueles definidos anualmente em portaria publicada pelo Ministério de Planejamento, Orçamento e Gestão. \r\nTendo em vista as peculiaridades das contagens do prazo, informamos estes são disponibilizados pelo próprio sistema do e-SIC de forma automática, facilitando o acompanhamento por parte do órgão e do requerente.\r\n', ''),
(16, '16- Como devem ser prestadas as informações?', 'As informações devem ser prestadas de forma atualizada, clara e em linguagem acessível, podendo ser fornecida por meio eletrônico ou físico. ', ''),
(17, '17- O que é transparência ativa?', 'É a divulgação de dados por iniciativa do próprio setor público, ou seja, quando são tornadas públicas informações, independente de requerimento, utilizando principalmente a Internet. \r\nUm exemplo de transparência ativa são as seções de acesso à informações dos sites dos órgãos e entidades. Os portais de transparência também são um exemplo disso.\r\nA divulgação proativa de informações de interesse público, além de facilitar o acesso das pessoas e de reduzir o custo com a prestação de informações, evita o acúmulo de pedidos de acesso sobre temas semelhantes.\r\n', ''),
(18, '18- Que informações os órgãos e entidades do Poder Executivo Municipal são obrigados a disponibilizar proativamente em seus sites?', 'O art. 8° da LAI definiu como um dever dos órgãos e entidades públicos publicar na internet informações públicas de interesse coletivo ou geral. os órgãos e entidades do Poder Executivo/Legislativo/Judiciario, deverão publicar o seguinte rol mínimo de informações nos seus sítios eletrônicos:\r\na) estrutura organizacional e competências dos órgãos, além dos endereços e telefones de suas unidades e horários de atendimento ao público;\r\nb) programas, projetos, ações, obras e atividades, indicando a unidade responsável, principais metas e resultados e indicadores (se existirem);\r\nc) repasses ou transferências de recursos financeiros;\r\nd) execução orçamentária e financeira detalhada;\r\ne) procedimentos licitatórios, com os contratos celebrados e notas de empenho emitidas;\r\nf) remuneração recebida por servidores e empregados públicos de maneira individualizada;\r\ng) respostas a perguntas mais frequentes da sociedade;\r\nh) contato da autoridade de monitoramento da LAI na instituição e informações sobre o Serviço de Informações ao Cidadão;\r\n', ''),
(19, '19- O órgão podera negar prestar a informação?', 'O órgão pode negar acesso total ou parcial a uma informação solicitada. Neste caso deverá justificar por escrito a sua negativa e informar ao requerente que há a possibilidade de recurso. Deverão ser informados os prazos e condições para tal recurso e qual autoridade irá analisá-lo. ', ''),
(20, '20- O que é transparência passiva?', 'É a disponibilização de informações públicas em atendimento a demandas específicas de uma pessoa física ou jurídica. Por exemplo, a resposta a pedidos de informação registrados para determinado Ministério, seja por meio do SIC físico do órgão ou pelo e-SIC (Sistema Eletrônico do Serviço de Informação ao Cidadão).', ''),
(21, '21- O que são informações de acesso restrito?', 'São aquelas informações que por sua natureza, quando divulgadas, podem trazer prejuízos à organização e integridade do Municipio, à sociedade ou ao cidadão, devendo, portanto ser tratadas de maneira mais restritas. As informações serão restritas quando disserem respeito à intimidade, vida privada, honra e imagem das pessoas, bem como às liberdades e garantias individuais. Estas informações só poderão ser fornecidas com a autorização da própria pessoal ou mediante determinação judicial. \r\n\"Art. 5º Todos são iguais perante a lei, sem distinção de qualquer natureza, garantindo-se aos brasileiros e aos estrangeiros residentes no País a inviolabilidade do direito à vida, à liberdade, à igualdade, à segurança e à propriedade, nos termos seguintes:\r\n[...]\r\n\r\nX- são invioláveis a intimidade, a vida privada, a honra e a imagem das pessoas, assegurado o direito à indenização pelo dano material ou moral, decorrente de sua violação;\"\r\n\r\nTambém serão tratadas como restritas as informações que podem colocar em risco a segurança nacional, prejudicar ou por em risco negociações ou relações internacionais, a vida, segurança ou saúde da população, a estabilidade financeira, econômica ou monetária do País, os projetos de pesquisa científica, tecnológica e estratégica, a segurança das instituições e atividades de inteligência. De acordo com a classificação dessas informações perdurará o prazo da restrição.\r\nPoderão ser classificadas como ultrassecretas 25 anos, secretas 15 anos, e reservadas 5 anos.\r\nCaberá a Comissão Mista de Reavaliação de Informações, nomeada especialmente para este fim, rever periodicamente tal avaliação. \r\n', ''),
(22, '22- O que é o SIC?', 'O art. 9° da Lei de Acesso instituiu como um dever do Estado a criação de um ponto de contato entre a sociedade e o setor público, que é o Serviço de Informações ao Cidadão - SIC.\r\nSão funções do SIC:\r\na) atender e orientar os cidadãos sobre pedidos de informação;\r\nb) informar sobre a tramitação de documentos e requerimentos de acesso à informação;\r\nc) receber e registrar os pedidos de acesso e devolver as respostas aos solicitantes.\r\nCada órgão e entidade do poder público deve se estruturar para tornar efetivo o direito de acesso à informação, sendo obrigatória a instalação do SIC pelo menos em sua sede, em local de fácil acesso e identificação pela sociedade.\r\n', ''),
(23, '23- O que é o e-SIC?', 'O Sistema Eletrônico do Serviço de Informação ao Cidadão (e-SIC) é um sistema que centraliza as entradas e saídas de todos os pedidos de acesso dirigidos ao Poder Executivo Federal. O objetivo do e-SIC é organizar e facilitar os procedimentos de acesso à informação tanto para os cidadãos quanto para a Administração Pública.\r\nO e-SIC permite que qualquer pessoa - física ou jurídica - encaminhe pedidos de acesso à informação para órgãos e entidades do Poder Executivo Federal. Por meio do sistema também é possível consultar as respostas recebidas; entrar com recursos; apresentar reclamações; entre outras ações.\r\n', ''),
(24, '24- Haverá punições para órgãos ou servidores que se neguem a prestar informações?', 'Servidores e órgãos que se negarem a prestar as informações injustificadamente ou utilizarem indevidamente às informações a que tiverem acesso em razão da função poderá responder civil, penal e administrativamente. ', ''),
(25, '25- O que é a LC 131?', 'A Lei Complementar 131, de 27 de maio de 2009, alterou a redação da Lei de Responsabilidade Fiscal no que se refere à transparência da gestão fiscal, inovando ao determinar a disponibilização, em tempo real, de informações pormenorizadas sobre a execução orçamentária e financeira da União, dos Estados, do Distrito Federal e dos Municípios. ', ''),
(26, '26 - Legislações', 'Lei de Finanças Publicas – 4320/64 - <a href=\"http://www.planalto.gov.br/ccivil_03/leis/L4320.htm\" target=\"_blank\">http://www.planalto.gov.br/ccivil_03/leis/L4320.htm </a><br>\r\nLei de Licitações – 8666/93 - <a href=\"http://www.planalto.gov.br/ccivil_03/leis/L8666cons.htm\" target=\"_blank\">http://www.planalto.gov.br/ccivil_03/leis/L8666cons.htm</a><br>\r\nLei do Pregão – 10520/02 - <a href=\"http://www.planalto.gov.br/ccivil_03/leis/2002/L10520.htm\" target=\"_blank\">http://www.planalto.gov.br/ccivil_03/leis/2002/L10520.htm</a><br>\r\nLei de responsabilidade Fiscal – LC 101/00  - <a href=\"https://www.planalto.gov.br/ccivil_03/leis/lcp/lcp101.htm\" target=\"_blank\">https://www.planalto.gov.br/ccivil_03/leis/lcp/lcp101.htm</a><br>\r\nLei do Portal da Transparência – LC 131/09 - <a href=\"http://www.planalto.gov.br/ccivil_03/leis/LCP/Lcp131.htm\" target=\"_blank\">http://www.planalto.gov.br/ccivil_03/leis/LCP/Lcp131.htm</a><br>\r\nLei de Acesso a Informação – Lei 12527/11 - <a href=\"http://www.planalto.gov.br/ccivil_03/_ato2011-2014/2011/Lei/L12527.htm\" target=\"_blank\">http://www.planalto.gov.br/ccivil_03/_ato2011-2014/2011/Lei/L12527.htm</a><br>\r\nDecreto que Regulamenta a LAI – Decreto 7724/12 - <a href=\"http://www.planalto.gov.br/ccivil_03/_ato2011-2014/2012/decreto/d7724.htm\" target=\"_blank\">http://www.planalto.gov.br/ccivil_03/_ato2011-2014/2012/decreto/d7724.htm</a>', '');
